import React, { Component } from 'react';
import "./Movie.css";

class Movie extends Component{
    render() {
        // console.log(this.props)
        return (
            <div>
                <MoviePoster/>
                <h1>{this.props.title}</h1>
            </div>
        );
    }
}

class MoviePoster extends Component {
    render() {
        return(
            <img src="https://ww.namu.la/s/9eb26d63e59ae7f7f2c8b129c7e1ff35a9f101eab5bab173aba013de41a79674f27573c016ba7efe8626d48b3e2753762f1251f76f10c33dd68c7d088b599d6a8193c97f82200214c1060e61c2f4bcf72ca3fd914c895c3c3fed1030cf8f4ec9"></img>
        )
    }
}
export default Movie
